import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  Box,
  Checkbox,
  FormControlLabel,
  FormHelperText,
  IconButton,
  Stack,
  Typography,
} from "@mui/material";
import React from "react";

const Bucket = () => {
  const label = { inputProps: { "aria-label": "Checkbox demo" } };
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        sx={{
          height: "70vh",
          backgroundColor: "#fff",
          // opacity: "0.7",
          width: "50%",
          borderRadius: "15px",
        }}
      >
        <Stack alignItems="center">
          <div style={{ margin: "20%" }}>
            <Typography variant="h4">Bucket</Typography>
          </div>
          <Typography>ขายส่งขั้นต่ำจำนวน 100 แพ็ค</Typography>
          <FormControlLabel control={<Checkbox />} label="จัดส่ง" />
          <FormHelperText>
            จัดส่งเฉพาะภาคกลางและภาคตะวันตก ภายใน 3 วันทำการ<br></br>*หมายเหตุ*
            นครปฐมส่งฟรี
          </FormHelperText>
          <FormControlLabel control={<Checkbox />} label="รับหน้าโรงงาน" />
        </Stack>
      </Box>
    </div>
  );
};

export default Bucket;
